 #include<iostream>
 using namespace std;

 struct ListNode {
      int val;
      ListNode *next;
      ListNode(int x) : val(x), next(NULL) {}
 };

/**
 * Definition for singly-linked list.
 * struct ListNode {
 *     int val;
 *     ListNode *next;
 *     ListNode(int x) : val(x), next(NULL) {}
 * };
 */
/**
 * Definition for singly-linked list.
 * struct ListNode {
 *     int val;
 *     ListNode *next;
 *     ListNode(int x) : val(x), next(NULL) {}
 * };
 */
struct node{
    ListNode* val;
    node* left;
    node* right;
    node(ListNode* v=NULL, node* l=NULL, node* r=NULL){
        val=v;
        left=l;
        right=r;
    }
};

struct hp{
    node* root;
    ListNode* head;
    ListNode* cur;
    hp(node* p=NULL){
        root=p;
        head=NULL;
        cur=head;
    }
    void insert(node* p, node* r=NULL){
        if(r==NULL)
            r=root;
        if (p!=NULL)
            if(p->val->val>r->val->val){
                if(r->right!=NULL)
                    insert(p,r->right);
                else r->right=p;
            }else{
                if(r->left!=NULL)
                    insert(p,r->left);
                else r->left=p;
            }
    }
    void solve(node* p=NULL){
        if(p==NULL)
            p=root;
        if(p->left!=NULL) solve(p->left);
        if(head==NULL) {
            head=p->val;
            cur=head;
        }else{
            cur->next=p->val;
            cur=cur->next;
        }
        if(p->right!=NULL) solve(p->right);
    }
};

class Solution {
public:
    ListNode *sortList(ListNode *head) {
        if(head==NULL||head->next==NULL)
            return head;
        ListNode* p=head->next;
        hp myhp(new node(head));
        while(p!=NULL){
            myhp.insert(new node(p));
            p=p->next;
        }
        myhp.solve();
        return myhp.head;
    }
};
